      .then((res) => res.json())
      .then((data) => console.log(data));

    console.log("API CALL");
  }, []);

  console.log("UI REFRESH");

  return (<div>
      <h1>Coin List</h1>
      {loading ? <h1>"Loading... "</h1> : ""}
    </div>)
}

export default Coin;
